  false,\n\t\"url\": null,\n\t\"notes\": \"Flows and concentrations of nutrients and
  algae (chlorophyll-a) were monitored at 23 supply water and discharge sites on the
  San Luis National Wildlife Refuge Complex from September 2004 to July 2006. These
  measurements were used to estimate the net proportions of these substances taken
  up from or discharged into waters passing through Refuge wetlands. These data indicate
  that wetlands substantially reduced the concentrations and loads of nitrogen, phosphorus,
  and algae in waters discharged into Salt and Mud Slough, tributaries to the San
  Joaquin River. Loads of potassium increased marginally while loads of total organic
  carbon increased substantially.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
